import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class Newsletter extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            position: "fixed",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
          }}
        >
          <div
            style={{
              display: "grid",
              gridTemplateColumns: "500px",
              gridAutoRows: "500px",
            }}
          >
            <span style={{}}>Join my newsletter</span>
            <div>
              <a href="#" style={{ textDecoration: "none" }}>
                <span
                  style={{
                    position: "relative",
                    top: 50,
                    backgroundColor: "black",
                    color: "white",
                    padding: 20,
                    fontSize: 40,
                    fontFamily: "Roboto",
                  }}
                >
                  Join here
                </span>
              </a>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Newsletter;
